import { create } from "zustand";

export const useCounterStore = create((set) => (
  { 
    number: 123,
    increaseCounterNumber: () => set((state) => ({number: state.number + 1})),
    decreaseCounterNumber: () => set((state) => ({number: state.number - 1}))
  }
));
